function App(){
  return(
    <div>
   <table>
    <tr>
      <th>Brand</th>
      <th>Top Speed</th>
      <th>Color</th>
    </tr>
    <tr>
      <td>{tesla.model}</td>
      <td>{tesla.speedStats.topSpeed}</td>
      <td>{tesla.coloursByPopularity[0]}</td>
    </tr>
    {/* <tr>
      <td>{honda.model}</td>
      <td>{hondaTopSpeed}</td>
      <td>{hondaTopColour}</td>
    </tr> */}
  </table>
  </div>
  )
}

export default App;
